import React from 'react';
import HarryPotterSoundtrack from '../audio/Harry-Potter-Soundtrack.mp3';

class Footer extends React.Component {
  render() {
    return (
      <footer className="app__footer">
        <p className="footer__name">Create by Ana JD</p>
        <p className="footer__copy">&copy; 2019</p>
        <audio autoPlay src={HarryPotterSoundtrack} id="pDst9A3sqis" />
      </footer>
    );
  }
}

export default Footer;
